import React from 'react';

const Settings = () => {
  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold text-gray-800">⚙️ Settings Screen</h1>
      <p className="mt-4 text-gray-600">
        Here users can update preferences, profile details, or toggle app options.
      </p>
    </div>
  );
};

export default Settings;
